import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <p>Welcome to your dashboard. Here you will find insights and manage your cybersecurity settings.</p>
    </div>
  );
};

export default Dashboard;
